//team script for show more toggle
jQuery('.expand').click(function(event){
    event.preventDefault();
    jQuery(this).parent().find("div").slideToggle("medium");
    var text = jQuery(this).html();
    jQuery(this).html(text == '<i class="fas fa-angle-down"></i>' ? '<i class="fas fa-angle-up"></i>' : '<i class="fas fa-angle-down"></i>');
});

jQuery('.search').click(function(event)
{
    event.preventDefault();
    jQuery('.search-box').slideToggle("medium");
    jQuery('.search').hide();
});

